import { useParams } from "react-router-dom";
import { useEffect } from "react";
import useFetchData from "../apiFetches/FetchData";
const User = () => {
  const { user } = useParams();
  useEffect(() => {
    useFetchData(`/users/${user}`);
  }, [user]);
  return <div>{user}</div>;
};
export default User;
